using System;
using System.IO;
using OfficeOpenXml;


public static class Snippet
{
	public static OfficeOpenXml.ExcelPackage func(System.String myFilename)
	{
		FileInfo fs = new FileInfo (myFilename);
		ExcelPackage pck = new ExcelPackage (fs);
		return pck;				
	}
}

using System;
using OfficeOpenXml;

public static class Snippet
{
	public static OfficeOpenXml.ExcelWorksheet func(OfficeOpenXml.ExcelPackage myExcelPackage, System.String mySheet)
	{
		ExcelWorksheet myWorksheet = myExcelPackage.Workbook.Worksheets[mySheet];
		myWorksheet.Select();
		return myWorksheet;	
	}

}

using System;
using OfficeOpenXml;

public static class Snippet
{
	public static System.String func(OfficeOpenXml.ExcelPackage myExcelPackage, OfficeOpenXml.ExcelWorksheet myWorksheet, System.String myRow, System.String myColumn, System.String myValue, System.Boolean myNumberValue)
	{
		string myCell = myColumn.Trim() + myRow.ToString();
		try
		{

			if (myNumberValue)
			{
				myWorksheet.Cells[myCell].Style.Numberformat.Format = "0.00" ;

				myWorksheet.Cells[myCell].Value = Convert.ToDecimal(myValue.Trim());
			}
			else
			{
				myWorksheet.Cells[myCell].Value = myValue.Trim();
			}
		}
		catch (Exception e)
		{
			return e.Message;
		}
		return "";
	}

}

